description:
The point file shows locations of major earthquakes of magnitude 4.5 or more in the world and 2.5 or more in the U.S. between May 24 and May 31, 2010 ( approximately 9AM UTC). 
Elsewhere on Finder! you may look for weekly earthquake shapefiles going back to Jan 2010.
Use keyword search &quot;quake&quot;, &quot;earthquake&quot;
